import React from 'react';
import { View, Text } from 'react-native';
import MainTemplate from '../components/templates/MainTemplate';

const ProfileScreen = () => {
  return (
    <MainTemplate>
      <Text style={{ fontSize: 24, fontWeight: 'bold' }}>Profile</Text>
    </MainTemplate>
  );
};

export default ProfileScreen;
